message:
@NativeMothering @WillBenton1 Aderholt never made any effort to get tech jobs here either. 

Tech employers want things Aderholt ignores. Strong infrastructure with high speed Internet and resources to support data hubs, good schools, and amenities.

Not poverty with massive brain drain and bad Internet.

@YourDadLikedIt Pretty good... talking to voters who are telling us they are done with 24 years of Aderholt doing nothing.

Now its just about making sure as many of them as possible know they don't have to accept it anymore.

And coffee... lots of coffee

@Robert_Aderholt has had 24 years to address trade issues in Congress.

He has failed. Completely and totally. Now its an election year so we hear from him again with the same empty promises.

Rob - no one believes it anymore. https://t.co/tjgVJLtHi3

@Robert_Aderholt sits on House Appropriations and for 24 years he has claimed he cares about deficits.

He voted against Covid Stimulus because of it. People like Aderholt got rich while the rest of us lost our homes, our jobs, and our businesses.

https://t.co/JXbQg1HEnT

@GovernorKayIvey @TLockette_Star @Robert_Aderholt maybe you might want to listen to Coach Saban and Governor Ivey?

Please?

At this point it is getting ridiculous.

@IvanaSuzette Dogs have made this campaign season liveable. 

No matter the news or whatever horrible 2020 thing gets thrown at us... getting to meet happy dogs out on the trail and how they want to cuddle when we come home is the best.

Even when they are ridiculously big and don't know it.

@Brasilmagic @geokem7 These stories are presented as feel good community pieces.

What they really are is a gross indictment of a failed system that leaves children and families desperately seeking charity and media attention in the hope that they get enough help to survive.

#Fixit #HealthDisparities

@CBS_42 How did the Sec. of State not realize this was going to be a high turnout election and take steps to ensure counties had the resources to make voting fast and secure?

Unless there was another reason why they didn't see long lines and discouraging wait time as problem? 

#VOTE

@Josh_Moon Well, its not like some of our leaders have completely failed to show any leadership or empathy towards how this has affected people.

